$resultat=sql_query(array("sql"=>$sql, "contexte"=>"maj32"));
while ($ligne=mysql_fetch_assoc($resultat)) {
    $ID=$ligne["ID"];
    $notice=get_objet_xml_by_id("exemplaire", $ID);
    if ($notice === false) {
        continue;
    }
    
    // Plugin de maj des notices
    $recherche=array(array("tag"=>"110"));
    $def_champ=array(array("code"=>"r", "type_modif_ss_champ"=>"add_si_absent", "nouv_valeur"=>"non"));
