    $plugin_modif_marcxml=array("nom_plugin"=>"catalogue/marcxml/modif_marcxml", "parametres"=>array("modifications"=>$modifications));

    $tmp=applique_plugin($plugin_modif_marcxml, array("notice"=>$notice));
    if ($tmp["succes"] != 1) {
         //die ("Erreur ! lors de la rindexation de la table obj_biblio_acces : ".$tmp["erreur"]);
        print ("Erreur lors de la modification de l'objet exemplaire : ID=$ID : ".$tmp["erreur"]."<br>\n");
